def operation_times(num_diff):
    sub_5_times = num_diff // 5
    sub_2_times = num_diff % 5 // 2
    sub_1_times = num_diff % 5 % 2

    return sub_5_times + sub_2_times + sub_1_times

def equal(arr):
    min_num = min(arr)

    min_sub_0_operation_times = 0
    min_sub_1_operation_times = 0
    min_sub_2_operation_times = 0
    min_sub_3_operation_times = 0
    min_sub_4_operation_times = 0
    for num in arr:
        if num != min_num:
            min_sub_0_operation_times += operation_times(num - min_num)
        if num != min_num - 1:
            min_sub_1_operation_times += operation_times(num - min_num + 1)
        if num != min_num - 2:
            min_sub_2_operation_times += operation_times(num - min_num + 2)
        if num != min_num - 3:
            min_sub_3_operation_times += operation_times(num - min_num + 3)
        if num != min_num - 4:
            min_sub_4_operation_times += operation_times(num - min_num + 4)

    return min(min_sub_0_operation_times, min_sub_1_operation_times, min_sub_2_operation_times, min_sub_3_operation_times, min_sub_4_operation_times)

